import React from 'react';

function Chart({ type, data, labels, analyticsInitialized }) {
  return (
    <div className={`chart-placeholder${analyticsInitialized ? ' analytics-initialized' : ''}`}
      style={{ border: '1px dashed #ccc', padding: 24, borderRadius: 12, background: '#f9fafb', textAlign: 'center' }}>
      <strong>{type} Chart</strong>
      <div>Labels: {labels && labels.join(', ')}</div>
      <div>Data: {data && data.join(', ')}</div>
    </div>
  );
}

export default Chart;
